import React, { Component } from "react";
import RentalItem from "./RentalItem";
import { fetchRentals } from "../../actions";
import { connect } from "react-redux";

class RentalList extends Component {
  constructor(props) {
    super(props);

    this.state = {
      rentals: [1, 2, 3]
    };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick = () => {
    const { rentals } = this.state;
    rentals.push(1);
    this.setState({ rentals });
  };
  componentDidMount() {
    this.props.fetchRentals(this.state.rentals);
  }

  render() {
    const { rentals } = this.props;
    console.log(this.props);
    return (
      <div>
        <div className="container__title">Places to stay around the world</div>
        <br />
        <div className="row">
          {rentals.map((rental, i) => (
            <div className="col-sm" key={i}>
              <RentalItem rental={rental} />
            </div>
          ))}
        </div>
        {/* <button onClick={this.handleClick}>Add Rental</button> */}
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    rentals: state.rentals
  };
};

export default connect(mapStateToProps, { fetchRentals })(RentalList);
